//     backgroundColor: '#222222',
//     justifyContent: 'center',
//     alignItems: 'center'
//   },
//   font: {
//     color: 'white'
//   }
// })

const Stack = createStackNavigator()

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen component={Home} />
        <Stack.Screen omponent={Text} />
      </Stack.Navigator>
    </NavigationContainer>
  )
}
